import React from 'react';
import Marquee from 'react-marquee-master';

function Lists() {

    const marqueeItems = ['One', 'Two', 'Three'];
    return (<div className='fixed-bottom'><Marquee direction='up' marqueeItems={marqueeItems} height='300px'/></div>) 
}

export default Lists;
